    - type: MetaData
      name: Искусство войны подручными средствами
    - type: Transform
      parent: 10967
    - type: Paper
      content: >-
        Глава 0. Введение.


        Лопата — примитивный инструмент, который не предназначен для войны. Однако если сильно прижмёт, то прочная лопата может использоваться для рукопашного боя против пехоты противника. Если тяжёлая лопата с значимым ускорением опустится на голову противника, то немалый шанс, что после этого жизнь противника прервётся по причине смерти.


        Лопату можно использоваться для сражения с танками, истребителями или даже ракетами дальнего действия.


        Глава 1. Историческая справка.


        Данное руководство вдохновлено реальными историческими подвигами самураев, которые могли своими катанами уничтожать танки или сбивать самолёты, отбивать падающие авиационные бомбы, не получая при этом повреждений. Известен случай, когда более семи сотен солдат регулярной армии потребовалось, чтобы убить всего одного среднетренированного самурая. Чтобы у обычных солдат появились шансы повторить их подвиги, была составлена данная методичка.


        Глава 2. Противодействие наземной технике.

        Порядок применении лопаты в отношении наземной  техники противника. В качестве примера рассмотрен линейный осадный танк СССП т-172:

        - бей лопатой по приборам наведения;

        - бей по кормовым нишам башни;

        - бей лопатой по пушке;

        - бей по забору между бронированием корпуса и башни. он достаточно велик, чтобы метнуть туда лопату с большого расстояния;

        - бей по бортам корпуса. их можно пробить даже при помощи старых моделей лопат;


        Глава 3. Противодействие воздушной технике.

        Порядок применения лопаты в отношении воздушной техники противника. В качестве примера рассмотрен стратосферный низкоорбитальный истребитель ОПЗ F-217:

        - бей по приборам навигации и боекомплекту;

        - бей по кабине пилота;

        - удар лопатой по корпусу разрушает антирадарное поркытие истребителя;

        - щебёнка, насыпанная в воздухозаборник, выводит двигатели из строя;


        Глава 4. Противоракетная оборона.

        Порядок применения лопаты в отношении средств класса "земля-воздух" и "воздух-воздух".

        В качестве примера рассмотрена стандартная самонаводящаяся ракета войск Империи Эдема - "Экскалибур":

        - бей по системе наведения и детонации;

        - попытайся расчленить ракету пополам;

        - бей по крыльям и хвостовым рулям;

        - заткни сопло черенком лопаты;


        Издание данной образовательной методички проспонсировано [название неразборчиво] на некоммерческой основе. Если вам понадобится больше лопат, вы знаете, где их приобрести.
